import React from 'react';
import VideosList from '../../../widgets/VideosList/videosList';

const VideosMain = () => {
    return (
        <VideosList
        type="card"
        query={'Covid+News'}
        order={'relevance'}
        duration={'short'}
        videoType={'video'}
        definition={'high'}
        maxResults={5}
        language={'en'}
        title={true}
        loadmore={true}
    />
    )
}

export default VideosMain;
